  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The NIMH Repository and Genomics Resource
  (RGR) stores biosamples, genetic, pedigree and clinical data collected in designated
  NIMH-funded human subject studies. The RGR database likewise links to other repositories
  holding data from the same subjects, including dbGAP, GEO and NDAR. The NIMH RGR
  allows the broader research community to access these data and biospecimens (e.g.,
  lymphoblastoid cell lines, induced pluripotent cell lines, fibroblasts) and further
  expand the genetic and molecular characterization of patient populations with severe
  mental illness.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
